import React from 'react';
import radioSelected from '../../assets/main/radio_selected.png';
import radioUnselected from '../../assets/main/radio_unselected.png';
import radioWrong from '../../assets/main/radio_wrong.png';

const QuizRadioButton = ({ value, checked, setter }) => {
  return (
    <>
      {checked ? (
        <img
          onChange={() => setter(value)}
          src={radioSelected}
          alt="radiobuttonTrue"
          style={{ cursor: 'pointer' }}
        />
      ) : (
        <img
          onClick={onClick}
          src={radioUnselected}
          alt="radiobuttonFalse"
          style={{ cursor: 'pointer' }}
        />
      )}
    </>
  );
};

export default QuizRadioButton;
